    "sand-lake-national-wildlife-refuge-narrative-report-september-1-1949-to-december-31-1949",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Sand Lake NWR
    and the easement refuges outlines Refuge accomplishments from September through
    December of 1949. The report begins by summarizing the weather conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. Resource management is outlined;
    topics include grazing, haying, and fur harvesting. The public relations section
    of the report describes recreational uses, Refuge visitors, and Refuge participation.
    Items of interest, N-R forms, and photographs are attached.",nt"license_title":
